import React, { Component } from 'react'
import Child from './Child'

class Parent extends Component {
    constructor(props) {
      super(props)

      this.state = {
         name:"",
      }
    }
    componentDidMount=()=>{
        setInterval=()=>{
            this.setState({
                name:"Aman",
            })
        }

    }
  render() {
    return (
      <div><Child name={this.state.name}/></div>
    )
  }
}

export default Parent
